import React from 'react';
import { View, StyleSheet } from 'react'


function WordOfDay ({word}) {


  return (
    <View styles={styles.baseText}>
      <section>
        <h1>
          {word}
        </h1>
    </section>
   </View>
  )
}

const styles = StyleSheet.create({
  baseText: {
    fontFamily: 'SFProDisplay-Regular',
    fontSize: 24,
    color: '#60BADA'
  }
});


export default WordOfDay;
